INSERT INTO `configuration` VALUES (1,'clar_categories','{\"general\":\"General issue\",\"tech\":\"Technical issue\"}','array_keyval','List of additional clarification categories'),(2,'script_timelimit','30','int','Maximum seconds available for compile/compare scripts. This is a safeguard against malicious code and buggy scripts, so a reasonable but large amount should do.'),(3,'script_memory_limit','2097152','int','Maximum memory usage (in kB) by compile/compare scripts. This is a safeguard against malicious code and buggy script, so a reasonable but large amount should do.'),(4,'script_filesize_limit','65536','int','Maximum filesize (in kB) compile/compare scripts may write. Submission will fail with compiler-error when trying to write more, so this should be greater than any *intermediate* result written by compilers.'),(5,'memory_limit','524288','int','Maximum memory usage (in kB) by submissions. This includes the shell which starts the compiled solution and also any interpreter like the Java VM, which takes away approx. 300MB! Can be overridden per problem.'),(6,'output_limit','4096','int','Maximum output (in kB) submissions may generate. Any excessive output is truncated, so this should be greater than the maximum testdata output.'),(7,'process_limit','64','int','Maximum number of processes that the submission is allowed to start (including shell and possibly interpreters).'),(8,'sourcesize_limit','256','int','Maximum source code size (in kB) of a submission. This setting should be kept in sync with that in \"etc/submit-config.h.in\".'),(9,'sourcefiles_limit','100','int','Maximum number of source files in one submission. Set to one to disable multiple file submissions.'),(10,'timelimit_overshoot','\"1s|10%\"','string','Time that submissions are kept running beyond timelimt before being killed. Specify as \"Xs\" for X seconds, \"Y%\" as percentage, or a combination of both separated by one of \"+|&\" for the sum, maximum, or minimum of both.'),(11,'verification_required','0','bool','Is verification of judgings by jury required before publication?'),(12,'show_affiliations','1','bool','Show country flags and affiliations names on the scoreboard?'),(13,'show_pending','0','bool','Show pending submissions on the scoreboard?'),(14,'show_compile','2','int','Show compile output in team webinterface? Choices: 0 = never, 1 = only on compilation error(s), 2 = always.'),(15,'show_sample_output','0','bool','Should teams be able to view a diff of their and the reference output to sample testcases?'),(16,'show_balloons_postfreeze','0','bool','Give out balloon notifications after the scoreboard has been frozen?'),(17,'penalty_time','20','int','Penalty time in minutes per wrong submission (if finally solved).'),(18,'compile_penalty','1','bool','Should submissions with compiler-error incur penalty time (and show on the scoreboard)?'),(19,'results_prio','{\"memory-limit\":99,\"output-limit\":99,\"run-error\":99,\"timelimit\":99,\"wrong-answer\":30,\"no-output\":10,\"correct\":1}','array_keyval','Priorities of results for determining final result with multiple testcases. Higher priority is used first as final result. With equal priority, the first occurring result determines the final result.'),(20,'results_remap','{}','array_keyval','Remap testcase result, e.g. to disable a specific result type such as \'no-output\'.'),(21,'lazy_eval_results','1','bool','Lazy evaluation of results? If enabled, stops judging as soon as a highest priority result is found, otherwise always all testcases will be judged.'),(22,'enable_printing','0','bool','Enable teams and jury to send source code to a printer via the DOMjudge web interface.'),(23,'time_format','\"%H:%M\"','string','The format used to print times. For formatting options see the PHP \'strftime\' function.'),(24,'default_compare','\"compare\"','string','The script used to compare outputs if no special compare script specified.'),(25,'default_run','\"run\"','string','The script used to run submissions if no special run script specified.'),(26,'allow_registration','0','bool','Allow users to register themselves with the system?'),(27,'allow_openid_auth','0','bool','Allow users to log in using OpenID'),(28,'openid_autocreate_team','1','bool','Create a team for each user that logs in with OpenID'),(29,'openid_provider','\"https://accounts.google.com\"','string','OpenID Provider URL'),(30,'openid_clientid','\"\"','string','OpenID Connect client id'),(31,'openid_clientsecret','\"\"','string','OpenID Connect client secret'),(32,'judgehost_warning','30','int','Time in seconds after a judgehost last checked in before showing its status as \"warning\".'),(33,'judgehost_critical','120','int','Time in seconds after a judgehost last checked in before showing its status as \"critical\".'),(34,'thumbnail_size','128','int','Maximum width/height of a thumbnail for uploaded testcase images.'),(35,'diskspace_error','1048576','int','Minimum free disk space (in kB) on judgehosts.');
