INSERT INTO `submission_file` VALUES (1,1,'\0	\r\r89\r\r\Z89\rThe previous bytes are binary data: ASCII characters \\000 to \\039\rto check whether the system can handle this.\r\n@EXPECTED_RESULTS@: COMPILER-ERROR\n','test-binary-content.c',0),(2,2,'/*\n * This program test binary output and should give WRONG-ANSWER, but\n * display diff correctly.\n *\n * @EXPECTED_RESULTS@: WRONG-ANSWER\n */\n\n#include <stdio.h>\n\n#define min(a,b) ((a)<(b) ? (a) : (b))\n\nint main()\n{\n	int c;\n\n	printf(\"testing all characters...\");\n	for(c=0; c<256; c++) {\n		if ( c%10==0 ) printf(\"\\ntesting characters %d-%d...\\n\",c,min(c+9,255));\n		printf(\"%c\",c);\n	}\n	printf(\"\\ndone.\\n\");\n\n	return 0;\n}\n','test-binary-output.c',0),(3,3,'/*\n * The result of this source depends on the specific java compile\n * script which is used. The original script requires a class \'Main\'\n * with \'public static void main(String[] args)\' method and will thus\n * fail with compiler-error. The new javac/gcj scripts autodetect the\n * class containing the main method and should correctly compile. Note\n * that to successfully compile, the source also has to be renamed to\n * match the _public_ class name \'foo\'. It is preferred to not define\n * classes public.\n *\n * @EXPECTED_RESULTS@: CORRECT,COMPILER-ERROR\n */\n\nimport java.io.*;\n\npublic class foo {\n	public static void main(String[] args) {\n		System.out.println(\"Hello world!\");\n	}\n};\n','test-classname.java',0),(4,4,'/*\n * This should fail with a COMPILER-ERROR\n *\n * @EXPECTED_RESULTS@: COMPILER-ERROR\n */\n\n#include <stdio.h>\n\nThis is not correct C-syntax and will give compilation errors!\n','test-compile-error.c',0),(5,5,'/*\n * This program should fail with a COMPILER-ERROR due to a timeout.\n *\n * The program reads from the \"infinite\" file /dev/zero. This may\n * cause the compiler to use up a large amount of memory.\n *\n * @EXPECTED_RESULTS@: COMPILER-ERROR\n */\n\n#include \"/dev/zero\"\n\nint main()\n{\n	return 0;\n}\n','test-compile-memory.c',0),(6,6,'/*\n * This should give compiler warnings and fail with NO-OUTPUT\n *\n * @EXPECTED_RESULTS@: NO-OUTPUT\n */\n\n#include <stdio.h>\n\nint main()\n{\n	char str[1000];\n\n	gets(str);\n\n	return 0;\n}\n','test-compile-warning.c',0),(7,7,'/*\n * This should fail with RUN-ERROR (due to exitcode != 0)\n *\n * @EXPECTED_RESULTS@: RUN-ERROR\n */\n\nint main()\n{\n	return 1;\n}\n','test-exitcode.c',0),(8,8,'/*\n * This should give COMPILER-ERROR on the default problem \'hello\',\n * since it includes a random extra file.\n *\n * @EXPECTED_RESULTS@: COMPILER-ERROR\n */\n\n#include <stdio.h>\n\nint main()\n{\n	char hello[20] = \"Hello world!\";\n#ifdef ONLINE_JUDGE\n	printf(\"%s\\n\",hello);\n#else\n	printf(\"ONLINE_JUDGE not defined\\n\");\n#endif\n	return 0;\n}\n','test-hello.c',0),(9,8,'This is a random text file!\n\nIt should *NOT* be valid syntax in any language, since we include it\nin multi-file submissions, but these should be rejected with\nCOMPILER-ERROR. If not, then teams could send in any code,\nprecompiled, or in another language, and thus circumvent language (and\npossibly other) restrictions.\n\n@*@!2<>>$#! %\n&`*!\'\"~\n','zz-random.txt',1),(10,9,'/*\n * This should give COMPILER-ERROR on the default problem \'hello\',\n * since it includes a random extra file.\n *\n * @EXPECTED_RESULTS@: COMPILER-ERROR\n */\n\n#include <iostream>\n#include <string>\n\nusing namespace std;\n\nint main()\n{\n	string hello(\"Hello world!\");\n	cout << hello << endl;\n	return 0;\n}\n','test-hello.cc',0),(11,9,'This is a random text file!\n\nIt should *NOT* be valid syntax in any language, since we include it\nin multi-file submissions, but these should be rejected with\nCOMPILER-ERROR. If not, then teams could send in any code,\nprecompiled, or in another language, and thus circumvent language (and\npossibly other) restrictions.\n\n@*@!2<>>$#! %\n&`*!\'\"~\n','zz-random.txt',1),(12,10,'/*\n * This should give COMPILER-ERROR on the default problem \'hello\',\n * since it includes a random extra file.\n *\n * @EXPECTED_RESULTS@: COMPILER-ERROR\n */\n\nimport java.io.*;\n\nclass Main {\n    public static void main(String[] args) throws Exception {\n		System.out.print(\"Hello world!\\n\");\n    }\n}\n','test-hello.java',0),(13,10,'This is a random text file!\n\nIt should *NOT* be valid syntax in any language, since we include it\nin multi-file submissions, but these should be rejected with\nCOMPILER-ERROR. If not, then teams could send in any code,\nprecompiled, or in another language, and thus circumvent language (and\npossibly other) restrictions.\n\n@*@!2<>>$#! %\n&`*!\'\"~\n','zz-random.txt',1),(14,11,'/*\n * Floods stderr and should fail with TIMELIMIT, since output is\n * automatically truncated at the filesize limit.\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\n#include <iostream>\n#include <string>\n\nint main()\n{\n	while ( 1 ) std::cerr << \"Fill stderr with nonsense, to test filesystem stability.\\n\";\n\n	return 0;\n}\n','test-fill-stderr.cpp',0),(15,12,'/*\n * Floods stdout and should fail with TIMELIMIT, since output is\n * automatically truncated at the filesize limit.\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\n#include <iostream>\n#include <string>\n\nint main()\n{\n	while ( 1 ) std::cout << \"Fill stdout with nonsense, to test filesystem stability.\\n\";\n\n	return 0;\n}\n','test-fill-stdout.cc',0),(16,13,'/*\n * Floods syslog and should fail with WRONG-ANSWER.\n * It must be checked manually that syslog is not flooded.\n * This should normally not happen if USE_CHROOT is enabled.\n *\n * @EXPECTED_RESULTS@: CHECK-MANUALLY\n */\n\n#include <stdio.h>\n#include <syslog.h>\n\nconst int maxmesg = 10000;\n\nint main()\n{\n	int i;\n\n	openlog(\"domjudge_test-fill-syslog\", LOG_PID, LOG_USER);\n\n	for(i=0; i<maxmesg; i++) {\n		syslog(LOG_NOTICE,\"Fill syslog with nonsense, should not be possible (%06d).\",i);\n	}\n\n	printf(\"%d lines written to syslog.\\n\",maxmesg);\n\n	return 0;\n}\n','test-fill-syslog.c',0),(17,14,'/*\n * This should fail with WRONG-ANSWER (C doesn\'t give floating point\n * errors when dividing by zero).\n *\n * @EXPECTED_RESULTS@: WRONG-ANSWER\n */\n\n#include <stdio.h>\n#include <math.h>\n\nint main()\n{\n	double a = M_PI/2;\n	double b;\n\n	b = tan(a);\n	a = exp(b);\n\n	printf(\"%lf\\n%lf\\n%lf\\n%lf\\n\",b,a,1/a,acos(b));\n\n	return 0;\n}\n','test-float.c',0),(18,15,'/*\n * This should fail with WRONG-ANSWER (C++ doesn\'t give floating point\n * errors when dividing by zero).\n *\n * @EXPECTED_RESULTS@: WRONG-ANSWER\n */\n\n#include <vector>\n#include <stdio.h>\n#include <math.h>\n\nint main()\n{\n	double a = M_PI/2;\n	double b;\n\n	std::vector<int> c(10);\n\n	b = tan(a);\n	a = exp(b);\n\n	printf(\"%lf\\n%lf\\n%lf\\n%lf\\n\",b,a,1/a,acos(b));\n\n	return 0;\n}\n','test-float.cc',0),(19,16,'/*\n * This code tries to fork a number of child processes and then exit\n * itself. Runguard should kill all child processes on normal exit,\n * when using Linux cgroups.\n *\n * The result should be a WRONG-ANSWER and the running forked child\n * processes killed. Without cgroup support, this will crash the\n * judgedaemon because the child processes are found still running.\n *\n * @EXPECTED_RESULTS@: WRONG-ANSWER\n */\n\n#include <unistd.h>\n#include <stdio.h>\n\nint main()\n{\n	int pid, i, successes = 0, failures = 0;\n	for(i = 0; i < 100; i++) {\n		int pid = fork();\n		if (pid == -1) {\n			failures += 1;\n		}\n		else if (pid == 0) {\n			while (1) {}; /* Child loops */\n		}\n		else {\n			successes += 1;\n		}\n	}\n	printf(\"%d forks succeeded, %d failed\\n\", successes, failures);\n	printf(\"parent process exiting now\\n\");\n\n	return 0;\n}\n','test-fork-parent-exit.c',0),(20,17,'/*\n * This code tries to fork as many processes as possible. The limit on\n * the number of processes will limit that and the program will\n * timeout.\n *\n * The result should be a TIMELIMIT and the running forked programs\n * killed by testcase_run.\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\n#include <unistd.h>\n\nint main()\n{\n	int parent = 1;\n	int a = 0;\n\n	while ( parent ) {\n		if ( fork()==0 ) {\n			parent = 0;\n			malloc(1);\n		}\n	}\n\n	while ( 1 ) a++;\n\n	return 0;\n}\n','test-fork.c',0),(21,18,'/*\n * This should give CORRECT or WRONG-ANSWER on the default problem\n * \'hello\' depending on whether lf-cr line ending is ok.\n *\n * @EXPECTED_RESULTS@: CORRECT,WRONG-ANSWER\n */\n\n#include <stdio.h>\n\nint main()\n{\n	char hello[20] = \"Hello world!\";\n	printf(\"%s\\n\\r\",hello);\n	return 0;\n}\n','test-hello-lf-cr.c',0),(22,19,'/*\n * This should give CORRECT or WRONG-ANSWER on the default problem\n * \'hello\' depending on how strict white space is checked for.\n *\n * @EXPECTED_RESULTS@: CORRECT,WRONG-ANSWER\n */\n\n#include <stdio.h>\n\nint main()\n{\n	char hello[20] = \"Hello   	 world!\";\n	printf(\"%s\\n\",hello);\n	return 0;\n}\n','test-hello-space.c',0),(23,20,'/*\n * This should give CORRECT on the default problem \'hello\'.\n *\n * @EXPECTED_RESULTS@: CORRECT\n */\n\n#include <stdio.h>\n\nint main()\n{\n	char hello[20] = \"Hello world!\";\n#ifdef ONLINE_JUDGE\n	printf(\"%s\\n\",hello);\n#else\n	printf(\"ONLINE_JUDGE not defined\\n\");\n#endif\n	return 0;\n}\n','test-hello.c',0),(24,21,'/*\n * This should give CORRECT on the default problem \'hello\'.\n *\n * @EXPECTED_RESULTS@: CORRECT\n */\n\n#include <iostream>\n#include <string>\n\nusing namespace std;\n\nint main()\n{\n	string hello(\"Hello world!\");\n	cout << hello << endl;\n	return 0;\n}\n','test-hello.c++',0),(25,22,'/*\n * This should give CORRECT on the default problem \'hello\'.\n *\n * @EXPECTED_RESULTS@: CORRECT\n */\n\n#include <iostream>\n#include <string>\n\nusing namespace std;\n\nint main()\n{\n	string hello(\"Hello world!\");\n	cout << hello << endl;\n	return 0;\n}\n','test-hello.cc',0),(26,23,'/*\n * This should give CORRECT on the default problem \'hello\'.\n *\n * @EXPECTED_RESULTS@: CORRECT\n */\n\nimport java.io.*;\n\nclass Main {\n    public static void main(String[] args) throws Exception {\n		System.out.print(\"Hello world!\\n\");\n    }\n}\n','test-hello.java',0),(27,24,'/*\n * This should give COMPILER-ERROR on the default problem \'hello\'.\n * Even though this program is valid, the accompanying file is not a\n * proper C-header file and thus should lead to a compiler error,\n * either failing on trying to interpret it as C-header file, or\n * disallowing random extra files in a submission.\n *\n * @EXPECTED_RESULTS@: COMPILER-ERROR\n */\n\n#include <stdio.h>\n\nint main()\n{\n	char hello[20] = \"Hello world!\";\n#ifdef ONLINE_JUDGE\n	printf(\"%s\\n\",hello);\n#else\n	printf(\"ONLINE_JUDGE not defined\\n\");\n#endif\n	return 0;\n}\n','test-hello.c',0),(28,24,'This is not a valid C header file!\n','zz-random-file.h',1),(29,25,'/*\n * Writes very long lines to stdout. Should give WRONG-ANSWER, but not\n * crash the system.\n *\n * @EXPECTED_RESULTS@: WRONG-ANSWER\n */\n\n#include <stdio.h>\n\n/* Keep nlines*linelen below source size limit: */\nconst int linelen = 131070;\nconst int nlines = 2;\n\nint main()\n{\n	int c, i;\n\n	for(c=0; c<nlines; c++) {\n		for(i=0; i<linelen; i++) putchar(\'0\'+c);\n		putchar(\'\\n\');\n	}\n\n	return 0;\n}\n','test-long-lines.c',0),(30,26,'/*\n * This should fail with RUN-ERROR due to running out of memory, which\n * is restricted. The amount allocated may seem to be half of the\n * available, but that is because (GNU implementation) STL vectors by\n * default allocate double the amount of memory requested.\n *\n * @EXPECTED_RESULTS@: RUN-ERROR\n */\n\n#include <iostream>\n#include <vector>\n\nusing namespace std;\n\nvector<char> a;\n\nint main()\n{\n	int p, i;\n\n	/*\n	  Watch out: resizing of a vector allocates AT LEAST that much memory!\n	  Testing shows, that (glibc 2.2.5) twice the requested amount is\n	  allocated, so e.g. when you have 64 MB memory available, already when\n	  resizing to more than 32 MB, you run out of memory.\n	*/\n	for(p=4; 1; p*=2) {\n		for(i=p/2; i<p; i+=p/4) {\n			cout << \"trying to allocate \" << i << \" MB... \";\n			a.resize(i*1024*1024,0);\n			if ( a.capacity()<i*1024*1024 ) {\n				cout << \"resizing failed.\" << endl;\n				return 0;\n			}\n			for(int j=a.capacity()/2; j<a.capacity(); j++) a[j] = j%137;\n			cout << \"allocated: \" << a.capacity()/1024/1024 << \" MB.\" << endl;\n		}\n	}\n\n	return 0;\n}\n','test-memsize.cc',0),(31,27,'/*\n * This should fail with RUN-ERROR due to running out of memory, which\n * is restricted. Check the amount available, because the java binary\n * might consume a lot of the total memory available.\n *\n * @EXPECTED_RESULTS@: RUN-ERROR\n */\n\nimport java.io.*;\n\nclass Main {\n    public static void main(String[] args) throws Exception {\n		int i;\n		int[][] ar = new int[10240][];\n\n		for(i=0; 1==1; i++) {\n			ar[i] = new int[1024*1024/4];\n			System.out.print(\"allocated \" + (i+1) + \" MB of memory\\n\");\n		}\n    }\n}\n','test-memsize.java',0),(32,28,'/*\n * This should fail in the default configuration with RUN-ERROR due to\n * running out of memory, which is restricted. When the memory limit is\n * set higher, it will give WRONG-ANSWER.\n *\n * @EXPECTED_RESULTS@: RUN-ERROR,WRONG-ANSWER\n */\n\n#include <stdio.h>\n#include <string.h>\n\n#define size 512\n\nchar a[size*1024*1024];\n\nint main()\n{\n	memset(a,0,size*1024*1024);\n\n	a[10] = 1;\n\n	printf(\"Statically allocated %d MB.\\n\",size);\n\n	return 0;\n}\n','test-memstatic64.c',0),(33,29,'/*\n * Tests that multifile java submissions work even with multiple packages.\n *\n * @EXPECTED_RESULTS@: CORRECT\n */\n\npackage zoo.goo.moo.b;\n\nimport foo.bar.a.A;\n\npublic class B {\n	public static void main(String[] args) {\n		A.foo();\n	}\n}\n','B.java',0),(34,29,'package foo.bar.a;\n\npublic class A {\n	public static void foo() {\n		System.out.println(\"Hello world!\");\n	}\n}\n','A.java',1),(35,30,'/*\n * This multifile submission should give C