give CORRECT when this is possible or RUN-ERROR when not.\n *\n * @EXPECTED_RESULTS@: RUN-ERROR\n */\n\n#include <fstream>\n#include <iostream>\n#include <string>\n\n#include <dirent.h>\n#include <errno.h>\n#include <unistd.h>\n#include <sys/stat.h>\n#include <sys/types.h>\n\nusing namespace std;\n\nint main()\n{\n	DIR *dp;\n	struct dirent *dirp;\n	string dir  = \"testcase/\";\n	string filepath, fline;\n	ifstream fin;\n\n	// Try various different levels of higher directories:\n	for(int i=0; i<=10; i++) {\n		dp = opendir( dir.c_str() );\n		if ( dp == NULL ) {\n			cerr << \"Error (\" << errno << \"): could not open dir \" << dir << endl;\n		} else {\n			break;\n		}\n		dir = \"../\" + dir;\n	}\n	// Error out if no directory could be opened. This should happen,\n	// even without a chroot, as the testcase cache directory should\n	// not be accessible nor readable for the domjudge-run user.\n	if ( dp == NULL ) return 1;\n\n	while ( (dirp = readdir( dp )) )\n	{\n		filepath = dir + \"/\" + dirp->d_name;\n\n		if ( filepath.find(\"testcase.hello\") == std::string::npos) continue;\n		if ( filepath.find(\".out\") == std::string::npos) continue;\n\n		fin.open( filepath.c_str() );\n		while (getline (fin,fline)) cout << fline << endl;\n		fin.close();\n	}\n\n	closedir( dp );\n\n	return 0;\n}\n','test-readtestdata.c++',0),(48,38,'/*\n * This should fail with RUN-ERROR due to integer division by zero,\n * giving an exitcode 136.\n *\n * @EXPECTED_RESULTS@: RUN-ERROR\n */\n\n#include <stdio.h>\n\nint main()\n{\n	int a = 0;\n	int b;\n\n	b = 10 / a;\n\n	printf(\"%d\\n\",b);\n\n	return 0;\n}\n','test-sigfpe.c',0),(49,39,'/*\n * This should fail with RUN-ERROR due to integer division by zero.\n *\n * @EXPECTED_RESULTS@: RUN-ERROR\n */\n\nimport java.io.*;\n\nclass Main {\n    public static void main(String[] args) throws Exception {\n		int a = 0;\n		int b = 10 / a;\n		System.out.println(b);\n    }\n}\n','test-sigfpe.java',0),(50,40,'/*\n * This should fail with RUN-ERROR due to a segmentation fault,\n * giving an exitcode 139.\n *\n * @EXPECTED_RESULTS@: RUN-ERROR\n */\n\nint main()\n{\n	int a[10];\n	int *b;\n\n	b = 10;\n	*b = a[-1000000];\n\n	return 0;\n}\n','test-sigsegv.c',0),(51,41,'/*\n * This should fail with a TIMELIMIT.\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\n#include <unistd.h>\n\nint main()\n{\n	while ( 1 ) sleep(1);\n\n	return 0;\n}\n','test-sleep.c',0),(52,42,'/*\n * Output answers slowly, should give TIMELIMIT with some output\n * However it doesn\'t give output: GNU C seems not to flush buffers\n * when it receives a signal.\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\n#include <stdio.h>\n\nint main()\n{\n	int i,j,k,l,x;\n\n	for(i=10; 1; i+=10) {\n		x = 0;\n		for(j=0; j<i; j++)\n			for(k=0; k<i; k++)\n				for(l=0; l<i; l++)\n					x++;\n\n		printf(\"%d ^ 3 = %d\\n\",i,x);\n//		fflush(NULL);\n	}\n\n	return 0;\n}\n','test-slow-output.c',0),(53,43,'/*\n * Output answers slowly, should give TIMELIMIT with some output\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\n#include <iostream>\n\nint main()\n{\n	int i,j,k,l,x;\n\n	for(i=10; 1; i+=10) {\n		x = 0;\n		for(j=0; j<i; j++)\n			for(k=0; k<i; k++)\n				for(l=0; l<i; l++)\n					x++;\n\n		std::cout << i << \" ^ 3 = \" << x << std::endl;\n	}\n\n	return 0;\n}\n','test-slow-output.cc',0),(54,44,'/*\n * Output answers slowly, should give TIMELIMIT with some output\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\nimport java.io.*;\n\nclass Main {\n    public static void main(String[] args) throws Exception {\n        int i,j,k,l,x;\n\n        for(i=10; true; i+=10) {\n			x = 0;\n			for(j=0; j<i; j++)\n				for(k=0; k<i; k++)\n					for(l=0; l<i; l++)\n						x++;\n\n			System.out.println(i + \" ^ 3 = \" + x);\n        }\n    }\n}\n','test-slow-output.java',0),(55,45,'/*\n * This allocates stack memory and should fail with RUN-ERROR due to\n * running out of memory, which is restricted.\n *\n * @EXPECTED_RESULTS@: RUN-ERROR\n */\n\n#include <stdio.h>\n#include <stdlib.h>\n#include <string.h>\n\nconst int mb   = 1024*1024;\n\nvoid recurse_malloc(int depth)\n{\n	char a[mb];\n	int i, j;\n\n	depth++;\n\n	/* Here we fill the array and do some random reads and writes to\n	 * prevent the compiler from optimizing away the array a. */\n	memset(a,0,mb);\n	i = rand() % mb;\n	j = rand() % mb;\n	a[i] = depth;\n\n	printf(\"Allocated %3d MB stack memory, foo = %d.\\n\",depth,a[j]);\n\n	fflush(stdout);\n\n	recurse_malloc(depth);\n}\n\nint main()\n{\n	recurse_malloc(0);\n\n	return 0;\n}\n','test-stacksize.c',0),(56,46,'/*\n * This code tries to send a SIGSTOP (and later SIGCONT) to the parent\n * controlling process. If this succeeds, the controller will be\n * suspended and not terminate the command after the timelimit.\n *\n * This should give TIMELIMIT on the default problem \'hello\'.\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\n#include <signal.h>\n#include <unistd.h>\n#include <stdio.h>\n\nint main()\n{\n	int sleeptime = 10;\n	int ppid = getppid();\n\n	kill(ppid, SIGSTOP);\n\n	signal(SIGTERM, SIG_IGN);\n\n	printf(\"sleeping for %d seconds\\n\",sleeptime);\n	sleep(sleeptime);\n	printf(\"still alive!\\n\");\n\n	kill(ppid, SIGCONT);\n\n	return 0;\n}\n','test-suspend-ppid.c',0),(57,47,'/*\n * This _should_ give NO-OUTPUT but used to give TIMELIMIT.\n * This is issue #122 and fixed now, see old description below.\n *\n * The reason for TIMELIMIT was that program and runguard stderr are\n * mixed and searched by testcase_run.sh for the string \'timelimit exceeded\'.\n * This a minor bug that doesn\'t provide a team any advantages. It\n * could be fixed by having runguard write the submission stderr to a\n * separate file.\n *\n * @EXPECTED_RESULTS@: NO-OUTPUT\n */\n\n#include <stdio.h>\n\nint main()\n{\n	fprintf(stderr,\"timelimit exceeded\\n\");\n	return 0;\n}\n','test-timelimit-bug.c',0),(58,48,'/*\n * This should give a TIMELIMIT.\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\nint main()\n{\n	int a = 0;\n\n	while ( 1 ) a++;\n\n	return 0;\n}\n','test-timelimit.c',0),(59,49,'/*\n * This should give CORRECT on the problem \'fltcmp\' (but WRONG ANSWER on \'hello\').\n *\n * @EXPECTED_RESULTS@: CORRECT\n */\n\n#include <stdio.h>\n#include <math.h>\n\nint main()\n{\n	int run, nruns;\n	double x, y;\n\n	scanf(\"%d\\n\",&nruns);\n\n	for(run=1; run<=nruns; run++) {\n		scanf(\"%lf\\n\",&x);\n		y = 1/x;\n		printf(\"%.7lf\\n\",y);\n	}\n\n	return 0;\n}\n','fltcmp-test-correct.c',0),(60,50,'/*\n * This should give WRONG ANSWER on the problem \'fltcmp\' with\n * precision errors.\n *\n * @EXPECTED_RESULTS@: WRONG-ANSWER\n */\n\n#include <stdio.h>\n#include <math.h>\n\nint main()\n{\n	int run, nruns;\n	double x, y;\n	double epsilon = 0.0001;\n\n	scanf(\"%d\\n\",&nruns);\n\n	for(run=1; run<=nruns; run++) {\n		scanf(\"%lf\\n\",&x);\n		y = 1/x + epsilon;\n		epsilon /= 6;\n		printf(\"%.7lf\\n\",y);\n	}\n\n	return 0;\n}\n','fltcmp-test-wrong1.c',0),(61,51,'/*\n * This should give WRONG ANSWER on the problem \'fltcmp\' for inputs\n * 0, 1 and INF.\n *\n * @EXPECTED_RESULTS@: WRONG-ANSWER\n */\n\n#include <stdio.h>\n#include <math.h>\n\nint main()\n{\n	int run, nruns;\n	double x, y;\n	int testinf = 0;\n\n	scanf(\"%d\\n\",&nruns);\n\n	for(run=1; run<=nruns; run++) {\n		scanf(\"%lf\\n\",&x);\n\n		if ( fabs(x-1)<0.0001 ) {\n			printf(\"+2.0\\n\");\n			continue;\n		}\n		if ( fabs(x)<0.0001 ) {\n			testinf = 1;\n			printf(\"%lE\\n\",0.0/-0);\n			continue;\n		}\n		if ( isinf(x) ) {\n			printf(\"%.7lf\\n\",1/0.0);\n			continue;\n		}\n\n		y = 1/x;\n		printf(\"%.7lf\\n\",y);\n	}\n\n	if ( testinf ) printf(\"0.0\\n\");\n\n	return 0;\n}\n','fltcmp-test-wrong2.c',0),(62,52,'/*\n * Sample solution in C for the \"boolfind\" interactive problem.\n *\n * @EXPECTED_RESULTS@: CORRECT\n */\n\n#include <stdio.h>\n#include <string.h>\n\nint run, nruns;\nlong long n, lo, hi, mid;\nchar answer[10];\nchar buf[256];\nint ch;\n\n/* Be careful not to read closing newlines as this will trigger the\n * call scanf to hang (trying to gobble up more whitespace?). Also we\n * flush output everytime.\n */\nint main()\n{\n	scanf(\"%d\",&nruns);\n\n	for(run=1; run<=nruns; run++) {\n\n		scanf(\"%lld\",&n);\n\n		lo = 0;\n		hi = n;\n		while ( lo+1<hi ) {\n			mid = (lo+hi)/2;\n			printf(\"READ %lld\\n\",mid); fflush(NULL);\n\n			scanf(\"%8s\",answer);\n			if ( strcmp(answer,\"true\")==0 ) {\n				lo = mid;\n			} else if ( strcmp(answer,\"false\")==0 ) {\n				hi = mid;\n			} else {\n				printf(\"invalid return value \'%s\'\\n\",answer);\n				return 1;\n			}\n		}\n		printf(\"OUTPUT %lld\\n\",lo); fflush(NULL);\n	}\n\n	return 0;\n}\n','boolfind-test-correct.c',0),(63,53,'/*\n * Sample solution in C++ for the \"boolfind\" interactive problem.\n *\n * @EXPECTED_RESULTS@: CORRECT\n */\n\n#include <iostream>\n#include <string>\n\nusing namespace std;\n\nint run, nruns;\nlong long n, lo, hi, mid;\nstring answer;\n\nint main()\n{\n	cin >> nruns;\n\n	for(run=1; run<=nruns; run++) {\n\n		cin >> n;\n\n		lo = 0;\n		hi = n;\n		while ( lo+1<hi ) {\n			mid = (lo+hi)/2;\n			cout << \"READ \" << mid << endl;\n			cin >> answer;\n			if ( answer==\"true\" ) {\n				lo = mid;\n			} else if ( answer==\"false\" ) {\n				hi = mid;\n			} else {\n				cout << \"invalid return value \'\" << answer << \"\'\\n\";\n				return 1;\n			}\n		}\n		cout << \"OUTPUT \" << lo << endl;\n	}\n\n	return 0;\n}\n','boolfind-test-correct.cc',0),(64,54,'/*\n * Sample solution in Java for the \"boolfind\" interactive problem.\n *\n * @EXPECTED_RESULTS@: CORRECT\n */\n\nimport java.io.*;\n\nclass Main\n{\n	public static BufferedReader in;\n\n	public static void main(String[] args) throws Exception\n	{\n		in = new BufferedReader(new InputStreamReader(System.in));\n\n		int nruns = Integer.parseInt(in.readLine());\n\n		for(int run=1; run<=nruns; run++) {\n\n			long n, lo, hi, mid;\n			String answer;\n\n			n = Integer.parseInt(in.readLine());\n\n			lo = 0;\n			hi = n;\n			while ( lo+1<hi ) {\n				mid = (lo+hi)/2;\n				System.out.println(\"READ \" + mid);\n				answer = in.readLine();\n				if ( answer.equals(\"true\") ) {\n					lo = mid;\n				} else if ( answer.equals(\"false\") ) {\n					hi = mid;\n				} else {\n					throw new Exception(\"invalid return value \'\" + answer + \"\'\");\n				}\n			}\n\n			System.out.println(\"OUTPUT \" + lo);\n		}\n	}\n}\n','boolfind-test-correct.java',0),(65,55,'/*\n * Sample solution in C++ for the \"boolfind\" interactive problem.\n * Gives correct answer, but with additional cruft on each line, so\n * should fail.\n *\n * @EXPECTED_RESULTS@: WRONG-ANSWER\n */\n\n#include <iostream>\n#include <string>\n\nusing namespace std;\n\nint run, nruns;\nlong long n, lo, hi, mid;\nstring answer;\n\nint main()\n{\n	cin >> nruns;\n\n	for(run=1; run<=nruns; run++) {\n\n		cin >> n;\n\n		lo = 0;\n		hi = n;\n		while ( lo+1<hi ) {\n			mid = (lo+hi)/2;\n			cout << \"READ \" << mid << endl;\n			cin >> answer;\n			if ( answer==\"true\" ) {\n				lo = mid;\n			} else if ( answer==\"false\" ) {\n				hi = mid;\n			} else {\n				cout << \"invalid return value \'\" << answer << \"\'\\n\";\n				return 1;\n			}\n		}\n		cout << \"OUTPUT \" << lo << \"  0\" << endl;\n	}\n\n	cout << \"THIS IS EXTRA DATA ON A FINAL LINE, NO NEWLINE!\";\n\n	return 0;\n}\n','boolfind-test-extradata.cc',0),(66,56,'/*\n * Sample solution in C for the \"boolfind\" interactive problem.\n * Exits immediately without any output.\n *\n * @EXPECTED_RESULTS@: NO-OUTPUT\n */\n\nint main()\n{\n	return 0;\n}\n','boolfind-test-no-output.c',0),(67,57,'/*\n * Sample solution in C for the \"boolfind\" interactive problem.\n * This program uses scanf and should hang on reading input,\n * resulting in a timelimit verdict.\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n */\n\n#include <stdio.h>\n#include <string.h>\n\nint run, nruns;\nlong long n, lo, hi, mid;\nchar answer[10];\nchar buf[256];\nint ch;\n\nint main()\n{\n	scanf(\"%d\\n\",&nruns);\n\n	for(run=1; run<=nruns; run++) {\n\n		scanf(\"%lld\\n\",&n);\n\n		lo = 0;\n		hi = n;\n		while ( lo+1<hi ) {\n			mid = (lo+hi)/2;\n			printf(\"READ %lld\\n\",mid); fflush(NULL