se the processes will belong to the\n * same cgroup.\n *\n * @EXPECTED_RESULTS@: TIMELIMIT\n * (or judgedaemon crash when cgroups disabled)\n */\n\n#include <unistd.h>\n\nint main()\n{\n	int parent = 1;\n	int a = 0;\n\n	while ( parent ) {\n		if ( fork()==0 ) {\n			parent = 0;\n			malloc(1);\n			setsid();\n		}\n	}\n\n	while ( 1 ) a++;\n\n	return 0;\n}\n','stress-test-fork-setsid.c',0),(72,62,'/*\n * This will try to reboot the computer by calling \'reboot\'. Of course\n * this should not work as this program should not run as root. This should\n * only generate a message to stderr, so result in NO-OUTPUT.\n *\n * @EXPECTED_RESULTS@: NO-OUTPUT\n */\n\n#include <stdlib.h>\n\nint main()\n{\n	return system(\"reboot\");\n}\n','stress-test-reboot.c',0);
